import React from "react";
import { Bar } from "react-chartjs-2"; // Import Bar chart from Chart.js
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

// Register Chart.js components
ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

const AnalysisDashboard = () => {
  // Example data for the chart
  const chartData = {
    labels: ["Placed Students", "Non-Placed Students"],
    datasets: [
      {
        label: "Student Placement Analysis",
        data: [30, 15], // Example data: 30 placed, 15 non-placed
        backgroundColor: ["rgba(75, 192, 192, 0.6)", "rgba(255, 99, 132, 0.6)"],
        borderColor: ["rgba(75, 192, 192, 1)", "rgba(255, 99, 132, 1)"],
        borderWidth: 1,
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: { position: "top" },
      title: { display: true, text: "Student Placement Analysis" },
    },
  };

  return (
    <div className="analysis-dashboard">
      <h2>Analysis Dashboard</h2>
      <Bar data={chartData} options={chartOptions} />
    </div>
  );
};

export default AnalysisDashboard;
